import React from "react";

import PageTemplate from "../Page_Template/PageTemplate";

import { Form, Header, Image, Message } from "semantic-ui-react";

import default_img from "../../assets/image.png";

export default function Preview({ form }) {
  return (
    <div>
      <PageTemplate>
        <Header as="h3">Preview Information</Header>

        <Header as="h4">General Information</Header>

        <Form>
          <Form.Group>
            <Form.Group>
              <Image
                src={
                  form["general_information"]["photo"] === null
                    ? default_img
                    : window.URL.createObjectURL(
                        form["general_information"]["photo"]
                      )
                }
                size="medium"
              />

<Message warning>
    <Message.Header>You must register before you can do that!</Message.Header>
    <p>Visit our registration page, then try again.</p>
  </Message>
            </Form.Group>
          </Form.Group>
        </Form>
      </PageTemplate>
    </div>
  );
}
